	getMonthAsString(month: any) {
		month = month + 1;
		if (month == 1) {
		  return 'Enero'
		}
		if (month == 2) {
		  return 'Febrero'
		}
		if (month == 3) {
		  return 'Marzo'
		}
		if (month == 4) {
		  return 'Abril'
		}
		if (month == 5) {
		  return 'Mayo'
		}
		if (month == 6) {
		  return 'Junio'
		}
		if (month == 7) {
		  return 'Julio'
		}
		if (month == 8) {
		  return 'Agosto'
		}
		if (month == 9) {
		  return 'Septiembre'
		}
		if (month == 10) {
		  return 'Octubre'
		}
		if (month == 11) {
		  return 'Noviembre'
		}
		if (month == 12) {
		  return 'Diciembre'
		}

		return 'Desconocido';
	  }

	 getPaymentMethodology(cmetodologiapago : any) {
		let xmetodologiapago = this.metodologiaList.find(element => element.id === parseInt(cmetodologiapago));
		return xmetodologiapago.value
	  }

	 changeDateFormat(date : any) {
		if (date) {
		  let dateArray = date.substring(0,10).split("-");
		  return dateArray[2] + '/' + dateArray[1] + '/' + dateArray[0];
		}
		else {
		  return ' ';
		}
	  }
	
